import React, { Fragment } from "react";
import Question from "./components/Question";

function App() {
  return (
    <Fragment>
      <div className="container">
        <header>
          <h1>Budget</h1>
          <Question />
        </header>
      </div>
    </Fragment>
  );
}

export default App;
